import React from 'react'
import * as Axios from 'axios'

class Location extends React.Component {


  constructor(props) {
    super(props);
    // this.getmethod = this.getmethod.bind(this);
    this.locate = this.locate.bind(this);
    this.updateStateWithArray = this.updateStateWithArray.bind(this);
    this.renderTheArray = this.renderTheArray.bind(this);
    this.state = ({ latitude: 59.38273599999999, longitude: 17.992799999999992 });
    // this.lat = this.lat.bind(this);
    // this.long = this.long.bind(this);
  }


  locate() {

    const posStatus = document.querySelector('#posStatus');
    //const locInfo = document.querySelector('#locInfo');
    posStatus.innerHTML = 'Locating...'
    if (navigator.geolocation) {
      console.log(this);
      navigator.geolocation.getCurrentPosition(this.getGeoLocation);

      // this.getmethod();

    }

  }

  render() {

    console.log(this.state.AllPlaceObjects);

    return (

      <div>
        <div>
          <button onClick={this.locate}>Get Location</button>
          <h2 id='posStatus'> </h2>
          
        </div>

        <div>
          {this.renderTheArray()}
        </div>

      </div>
    )

  }

  renderTheArray() {

    if(this.state.AllPlaceObjects){
    let tempPlaces = this.state.AllPlaceObjects;
    let arrayWithHTML = [];

    console.log(this.state.AllPlaceObjects);
    console.log(tempPlaces);

    console.log(this.state.AllPlaceObjects.length);

    for(const onePlace of this.state.AllPlaceObjects){
      arrayWithHTML.push(<div>Fordonstyp: {onePlace.vehicle}</div>);
      arrayWithHTML.push(<div>Distrikt: {onePlace.cityDistrict}</div>);
    
      console.log(onePlace);
    }

    // for(let i = 0; i < this.state.AllPlaceObjects.length; i++){
    //   arrayWithHTML.push(<div>{this.state.AllPlaceObjects[i].vehicle}</div>);
    // }

    console.log(arrayWithHTML[0]);

    return ( 
      <React.Fragment>
          <span>API info</span>
            {arrayWithHTML}
      </React.Fragment>
    )
    } else {
      return (      
      <React.Fragment>
        <span>Den har inte printat än</span>
      </React.Fragment>)
    }
  }

  // getmethod () {

  //     Axios.get(`http://localhost:8080/location?lat=${this.state.lat}&lng=${this.state.long}`
  //         )
  //       .then(function (response) {
  //         console.log(response);
  //       })
  //       .catch(function (error) {
  //         console.log(error);
  //       });
  // }


  getGeoLocation = (position) => {

    let setArray =  this.updateStateWithArray;

    const array = [];
    Axios.get(`http://localhost:8080/location?lat=${position.coords.latitude}&lng=${position.coords.longitude}`
    )
      .then(function (response) {
        for (const property of response.data) { //om response.data är en array
          array.push(property);
          console.log(property);
          //detta pushar in alla dataobject i data arrayen.
        }
        console.log('här kommer en array');
        console.log(JSON.stringify(array));
        setArray(array);
      })
      .catch(function (error) {
        console.log(error);
      });

      // this.updateStateWithArray(array);

    //   return (            
    //   <React.Fragment>
    //       <div>
    //           {array}
    //       </div>
    // </React.Fragment>
    // );
  }

  updateStateWithArray(array) {
    this.setState({ AllPlaceObjects: array });
    console.log("hejhejhejhejhejhejhejhej");
  }
}

export default Location
